	internal static int GetLocaleDataNumericPart(string cultureName, IcuLocaleDataParts part)
	{
		int num = SearchCultureName(cultureName);
		if (num < 0)
		{
			return -1;
		}
		ReadOnlySpan<byte> readOnlySpan = NameIndexToNumericData.Slice(num * 18, 18);
		return part switch
		{
			IcuLocaleDataParts.Lcid => readOnlySpan[2] | (readOnlySpan[1] << 8) | (readOnlySpan[0] << 16), 
			IcuLocaleDataParts.AnsiCodePage => ((readOnlySpan[4] & 0xF0) >> 4) | ((readOnlySpan[3] & 0xFF) << 4), 
			IcuLocaleDataParts.OemCodePage => readOnlySpan[5] | ((readOnlySpan[4] & 0xF) << 8), 
			IcuLocaleDataParts.MacCodePage => readOnlySpan[7] | (readOnlySpan[6] << 8), 
			IcuLocaleDataParts.EbcdicCodePage => readOnlySpan[9] | (readOnlySpan[8] << 8), 
			IcuLocaleDataParts.GeoId => readOnlySpan[13] | (readOnlySpan[12] << 8) | (readOnlySpan[11] << 16) | (readOnlySpan[10] << 24), 
			IcuLocaleDataParts.DigitSubstitutionOrListSeparator => ResolveDigitListSeparator(readOnlySpan[14]), 
			IcuLocaleDataParts.SpecificLocaleIndex => ResolveIndex(((readOnlySpan[16] & 0xF0) >> 4) | ((readOnlySpan[15] & 0xFF) << 4)), 
			IcuLocaleDataParts.ConsoleLocaleIndex => ResolveIndex(readOnlySpan[17] | ((readOnlySpan[16] & 0xF) << 8)), 
			_ => -1, 
		};
		static int ResolveDigitListSeparator(int value)
		{
			return ((value & 0xF0) << 12) | (value & 0xF);
		}
		static int ResolveIndex(int value)
		{
			if (value != 4095)
			{
				return value;
			}
			return -1;
		}
	}

	internal static string GetThreeLetterWindowsLanguageName(string cultureName)
	{
		int num = SearchCultureName(cultureName);
		if (num < 0)
		{
			return null;
		}
		return GetString(ThreeLetterWindowsLanguageName.Slice(num * 3, 3));
	}

	private static string GetLocaleDataMappedCulture(string cultureName, IcuLocaleDataParts part)
	{
		int localeDataNumericPart = GetLocaleDataNumericPart(cultureName, part);
		if (localeDataNumericPart < 0)
		{
			return "";
		}
		return GetString(GetCultureName(localeDataNumericPart));
	}

	internal static string GetSpecificCultureName(string cultureName)
	{
		return GetLocaleDataMappedCulture(cultureName, IcuLocaleDataParts.SpecificLocaleIndex);
	}

	internal static string GetConsoleUICulture(string cultureName)
	{
		return GetLocaleDataMappedCulture(cultureName, IcuLocaleDataParts.ConsoleLocaleIndex);
	}

	private static int SearchCultureName(string name)
	{
		if (name.Length > 14)
		{
			return -1;
		}
		Span<byte> span = stackalloc byte[name.Length];
		for (int i = 0; i < name.Length; i++)
		{
			char c = name[i];
			span[i] = (((uint)(c - 65) <= 25u) ? ((byte)(c | 0x20u)) : ((byte)c));
		}
		ReadOnlySpan<byte> other = span;
		int num = 0;
		int num2 = 863;
		while (num <= num2)
		{
			int num3 = num + (num2 - num >> 1);
			int num4 = GetCultureName(num3).SequenceCompareTo(other);
			if (num4 == 0)
			{
				return num3;
			}
			if (num4 < 0)
			{
				num = num3 + 1;
			}
			else
			{
				num2 = num3 - 1;
			}
		}
		return ~num;
	}

	private static ReadOnlySpan<byte> GetCultureName(int localeNameIndice)
	{
		ReadOnlySpan<byte> localesNamesIndexes = LocalesNamesIndexes;
		int num = localeNameIndice * 2;
		int num2 = localesNamesIndexes[num];
		int num3 = localesNamesIndexes[num + 1];
		int start = (num2 << 4) | (num3 >> 4);
		int length = num3 & 0xF;
		return CultureNames.Slice(start, length);
	}

	private static string GetString(ReadOnlySpan<byte> buffer)
	{
		string text = string.FastAllocateString(buffer.Length);
		Span<char> span = new Span<char>(ref text.GetRawStringData(), buffer.Length);
		for (int i = 0; i < buffer.Length; i++)
		{
			span[i] = (char)buffer[i];
		}
		return text;
	}
